window.bookSummaryJSON = "<p>It’s <i>Downton Abbey</i> with magic, in Bath’s secret mirror city </p> <p>Cathy has been forced into an arranged marriage with William Iris - a situation that comes with far more strings than even she could have anticipated, especially when she learns of his family’s intentions for them both. </p> <p>Meanwhile, Max and the gargoyle investigate the Agency - a mysterious organization that appears to play by its own twisted rules, none of them favourable to Society. </p> <p>And in Mundanus, Sam has discovered something very peculiar about his wife’s employer - something that could herald disaster for everyone on both sides of the Split Worlds.</p>"; 
